import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>Movies</h1>
      <div className="links">
        <Link to="/">Home</Link>
        <Link to="../pages/Create" style={{ 
          color: 'white', 
          backgroundColor: '#f1356d',
          borderRadius: '8px' 
        }}>New Movie</Link>
      </div>
    </nav>
  );
}
 
export default Navbar;
